	struct DataSet
	{
		string num1;
		string num2;
		string result;
	};

	void generateAndPrintTestData()
	{
		int setSize = 500;
		vector<DataSet> testDataVector(setSize * 4);

		{
			int index = -1;
			//1 to 100 digits numbers
			for (int i = 0; i < setSize; ++i)
			{
				string s1, s2;
				int length = rand() % 100 + 1;
				s1.resize(length);
				for (int k = 0; k < length; ++k)
					s1[k] = '0' + rand() % 10;

				length = rand() % 100 + 1;
				s2.resize(length);
				for (int k = 0; k < length; ++k)
					s2[k] = '0' + rand() % 10;

				testDataVector[++index] = { s1, s2, longMultiplicationInBase10(s1, s2) };
			}

			//101 to 200 digits numbers
			for (int i = 0; i < setSize; ++i)
			{
				string s1, s2;
				int length = 100 + rand() % 100 + 1;
				s1.resize(length);
				for (int k = 0; k < length; ++k)
					s1[k] = '0' + rand() % 10;

				length = 100 + rand() % 100 + 1;
				s2.resize(length);
				for (int k = 0; k < length; ++k)
					s2[k] = '0' + rand() % 10;

				testDataVector[++index] = { s1, s2, longMultiplicationInBase10(s1, s2) };
			}

			//201 to 300 digits numbers
			for (int i = 0; i < setSize; ++i)
			{
				string s1, s2;
				int length = 200 + rand() % 100 + 1;
				s1.resize(length);
				for (int k = 0; k < length; ++k)
					s1[k] = '0' + rand() % 10;

				length = 200 + rand() % 100 + 1;
				s2.resize(length);
				for (int k = 0; k < length; ++k)
					s2[k] = '0' + rand() % 10;

				testDataVector[++index] = { s1, s2, longMultiplicationInBase10(s1, s2) };
			}

			//300 digits numbers
			for (int i = 0; i < setSize; ++i)
			{
				string s1, s2;
				int length = 300;
				s1.resize(length);
				for (int k = 0; k < length; ++k)
					s1[k] = '0' + rand() % 10;

				s2.resize(length);
				for (int k = 0; k < length; ++k)
					s2[k] = '0' + rand() % 10;

				testDataVector[++index] = { s1, s2, longMultiplicationInBase10(s1, s2) };
			}

			// Write everything to file
			ofstream dataFile;
			try
			{
				dataFile.open("C:/test/multiplicationTestDataFile.txt");
			}
			catch (std::ofstream::failure &writeErr)
			{
				cout << "\nERROR: Can not open file: " << " Error: " << writeErr.what() << endl;
			}
			catch (...)
			{
				cout << "\nUNKNOWN ERROR while opening file: " << endl;
			}

			if (dataFile.is_open())
			{

				dataFile << "\n\n============= Print all numbers ====================\n\n";
				//dataFile.write(str.c_str(), str.length());

				for (int i = 0; i < testDataVector.size(); ++i)
				{
					if (i % setSize == 0)
					{
						cout << "\nGenerating next set...";
						dataFile << "\n\n//\n\n";
						//dataFile.write(str.c_str(), str.length());
					}

					dataFile << "{ \"" + testDataVector[i].num1 + "\", \"" + testDataVector[i].num2 + "\", \"" + testDataVector[i].result + "\" },\n";
					//dataFile.write(str.c_str(), str.length());
					dataFile.flush();
				}

				dataFile << "\n\n ======= end =======\n\n";
				//dataFile.write(str.c_str(), str.length());
				dataFile.close();
			}
		}

		cout << "\nPress any key to procced...";
		cin.get();
	}

